import { ViewIcon } from "lucide-react";
import React, { useEffect, useState } from "react";
import axios from "axios";
function UpdateMarks({onlick,projectId}) {
  const [examName, setExamaName] = useState("Review1");
  const [data,setData] = useState();
  useEffect(()=>{
      const getData = async(req,res)=>{
        try {
            const response = await axios(`http:/localhost:3001/groupData/${projectId}`);
            setData(response.data);
        } catch (error) {
          console.log(error); 
        }
      }
      getData();
  })
  return (
    <div className="mt-10 mx-10">
      <div className="w-full flex flex-col lg:flex-row justify-end items-center">
        <div className="flex flex-row gap-4">
          <button className="bg-bgBlueDark text-white p-2 rounded-full" onClick={()=>setExamaName('Review1')}>Review1 </button>
          <button className="bg-bgBlueDark text-white p-2 rounded-full" onClick={()=>setExamaName('Review2')}>Review2</button>
        </div>
      </div>

      <table className="min-w-full bg-cardColor shadow-md mt-5 rounded-md overflow-hidden">
        <thead className="bg-color1 text-black">
          <tr>
            <th className="py-3 px-4 text-left">SN.</th>
            <th className="py-3 px-4 text-left">Admission Number</th>
            <th className="py-3 px-4 text-left">{examName}</th>
            <th className="py-3 px-4 text-left ">Action</th>
          </tr>
        </thead>
        <tbody>

              {data.map((d,index)=>(
                <div key={index}>
                  <tr>
                    <td>{d.StudentID}</td>

                  </tr>

                </div>
              ))}

        </tbody>
      </table>
    </div>
  );
}

export default UpdateMarks;
